#include <stdio.h>

int isPrime(int num) {
    if (num <= 1) {
        return 0;
    }
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) {
            return 0;
        }
    }
    return 1;
}

int main() {
    int n, choice;

    printf("Enter a positive integer n: ");
    scanf("%d", &n);

    printf("Enter your choice (1 for even numbers, 2 for odd numbers, 3 for prime numbers): ");
    scanf("%d", &choice);

    if (choice == 1) {
        printf("Even numbers from 1 to %d:\n", n);
        for (int i = 2; i <= n; i += 2) {
            printf("%d ", i);
        }
    } else if (choice == 2) {
        printf("Odd numbers from 1 to %d:\n", n);
        for (int i = 1; i <= n; i += 2) {
            printf("%d ", i);
        }
    } else if (choice == 3) {
        printf("Prime numbers from 1 to %d:\n", n);
        for (int i = 2; i <= n; i++) {
            if (isPrime(i)) {
                printf("%d ", i);
            }
        }
    } else {
        printf("Error: Invalid choice!");
    }

    return 0;
}
```

This program prompts the user to enter a positive integer `n` and a choice. It then uses conditional statements to determine the user's choice and performs the corresponding action. The `isPrime` function is used to check if a number is prime.

