def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num**0.5) + 1):
        if num % i == 0:
            return False
    return True

def print_numbers(n, choice):
    if choice == 1:
        for i in range(2, n+1, 2):
            print(i, end=' ')
    elif choice == 2:
        for i in range(1, n+1, 2):
            print(i, end=' ')
    elif choice == 3:
        for i in range(2, n+1):
            if is_prime(i):
                print(i, end=' ')
    else:
        print("Error: Invalid choice")

n = int(input("Enter a positive integer: "))
choice = int(input("Enter your choice (1 for even, 2 for odd, 3 for prime): "))
print_numbers(n, choice)
```

This program prompts the user to enter a positive integer `n` and a choice. It then prints the desired sequence of numbers based on the user's choice. If the user enters an invalid choice, it displays an error message.
